import React, { Fragment } from "react";
import { MDBBtn } from "mdbreact";

const ButtonInicio = () => {


  return (
    <Fragment>
      <MDBBtn outline color="primary" className="d-inline">GALERIA</MDBBtn>
      <MDBBtn outline color="primary" className="d-inline">CONTACTO</MDBBtn>

    </Fragment>
  );
}

export default ButtonInicio;
